import React from "react";
import { Container, Row, Col, Form } from "react-bootstrap";
import "./style.css";

const Box = (props) => {
    return ( 
        <div style={{padding: "30pt"}}>
            <Row>
                <Col>
                <Form.Control type="email" placeholder={props.text} />
                </Col>
                <Col>
                <Form.Control type="email" placeholder={props.text} />
                </Col>
            </Row>
        </div>
     );
}

const Contact = () => {
    return (
        <div style={{paddingTop:"150pt", paddingBottom: "150pt"}}>
            <Container>
                <h1>Contact Us</h1>
                <Box />
                <Box />
            </Container>
        </div>
    )
}

export default Contact;
